import React from 'react';

interface IProps {
    img : string;
    title : string;
}

interface IState {}

class Card extends React.Component<IProps, IState>{

    constructor(props:IProps) {
        super(props);
    }

    render() {
        return (
            <React.Fragment>
                <div className="card">
                    <img src={this.props.img} alt="" className="img-fluid"/>
                    <div className="card-body">
                        <h2>{this.props.title}</h2>
                        <p className="card-text">Lorem ipsum dolor sit amet, consectetur adipisicing elit. Accusantium architecto dolore ea excepturi laudantium magni nisi nobis officia perferendis repellendus.</p>
                    </div>
                </div>
            </React.Fragment>
        );
    }
}
export default Card;
